window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"name":"cucumber-jvm","version":"7.18.1"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"17.0.10+7"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1724036582,"nanos":323331700}}},{"source":{"uri":"file:\/\/\/C:\/NumpyNinja\/NN_DS_Algo\/DS_ALGO_August_Currently%20Working\/NN_DS_ALGO_SDET-WARRIORS\/.\/FeatureFiles\/Array.feature","data":"Feature: Testing the functionalities of Array Page\r\n\r\nBackground: Login to the DS ALGO Application\r\n\r\n Given User moves to home page after login to application\r\n When The User clicks the Array Get Started button\r\n Then The User should navigate to the Array Page\r\n \r\n## Array Page\r\n\r\nScenario: Testing the Arrays in Python link in Array Page\r\n\r\nGiven The User is in the Array Page \r\nWhen The User clicks the Arrays in Python link in the array Page\r\nThen The User should be redirected to the Arrays In Python Page\r\n\r\nScenario: Testing the arrays-using-list  Link in Array Page\r\n\r\nGiven The User is in the Array Page\r\nWhen The User clicks the arrays-using-list link in the array Page\r\nThen The User should be redirected to the arrays-using-list Page\r\n\r\n\r\nScenario: Testing the Arrays in Basic Operations List link from Array Page\r\n\r\nGiven The User is in the Array Page \r\nWhen The User clicks the Basic Opearations List link in the array Page\r\nThen The User should be redirected to the Basic Opearations List link Page\r\n\r\n\r\nScenario: Testing the Arrays in Applications of Array link from Array Page\r\n\r\nGiven The User is in the Array Page\r\nWhen The User clicks the Applications of Array link in the array Page\r\nThen The User should be redirected to the Applications of Array link Page\r\n\r\n\r\n## Arrays in Python Page Scenarios\r\n\r\nScenario: Testing the  Arrays in Python Page Try Here button \r\n\r\nGiven The user is in Arrays in Python Page\r\nWhen The user clicks the Try here button in this Page\r\nThen The User should be redirected to Python Editor page\r\n\r\n\r\nScenario: Testing the  Arrays in Python Page - Python Editor with Valid Python codes\r\n\r\nGiven The user is in the Arrays in Python Page PY Editor Page\r\nWhen The user write the Valid python code in Editor and Clicks Run button\r\nThen The User should be able to see the output in the console\r\n\r\nScenario: Testing the  Arrays in Python Page - Python Editor with In-Valid Python codes\r\n\r\nGiven  The user is in the Arrays in Python Page PY Editor Page\r\nWhen The user write the Valid python code in Editor and Clicks Run button\r\nThen The User should be able to see the output in the console\r\n\r\nScenario: Testing the  Arrays in Python Page - Python Editor without Python codes\r\n\r\nGiven The user is in the Arrays in Python Page PY Editor Page\r\nWhen The user clicks the Run without any Codes\r\nThen The User should should be in the same page with No error message \r\n\r\n\r\n## Left Panel links Scenarios\r\n\r\nScenario: Testing the Arrays In Python link in left panel links \r\n\r\n\r\nGiven The user is in Arrays in Python Page\r\nThen The user clicks the  Arrays in Python link from the left panel\r\nThen The user should stayed in the same Arrays in Python Page\r\n\r\n\r\nScenario: Testing the Arrays Using List link in left panel links \r\n\r\nGiven The user is in Arrays in Python Page\r\nWhen The user clicks the Arrays Using List link in the array Page from the left panel\r\nThen The User should be redirected to the arrays-using-list Page\r\n\r\nScenario: Testing the --  Basic Operations in List link in left panel links \r\n\r\nGiven The user is in Arrays in Python Page\r\nWhen The user clicks the Basic Operations in List link in the array Page from the left panel\r\nThen The User should be redirected to the Basic Opearations List link Page \r\n\r\nScenario: Testing the Applications of Array link in left panel links \r\n\r\nGiven The user is in Arrays in Python Page\r\nWhen The user clicks the Applications of Array in the array Page from the left panel\r\nThen The User should be redirected to the Applications of Array link Page\r\n\r\n\r\nScenario: Testing the Practice Questions in List link in left panel links \r\n\r\nGiven The user is in Arrays in Python Page\r\nWhen The user clicks the Practice Questions  in the array Page from the left panel\r\nThen The user should be Redirected to the Practice Questions Page\r\n\r\n\r\n#     Arrays using list Scenarios\r\n\r\n\r\nScenario: Testing the  Arrays using list Python Editor page with Valid Python codes\r\n\r\nGiven The user is in the Arrays using list PY Editor Page\r\nWhen The user write the Valid python code in Editor and Clicks Run button\r\nThen The User should be able to see the output in the console\r\n\r\n\r\nScenario: Testing the  Arrays using list Page - Python Editor with In-Valid Python codes\r\n\r\nGiven The user is in the Arrays using list PY Editor Page\r\nWhen The user write the Valid python code in Editor and Clicks Run button\r\nThen The User should be able to see the output in the console\r\n\r\n\r\nScenario: Testing the  Arrays using list Page - Python Editor without Python codes\r\n\r\nGiven The user is in the Arrays using list PY Editor Page\r\nWhen The user clicks the Run without any Codes\r\nThen The User should should be in the same page with No error message \r\n\r\n\r\nScenario: Testing the Try here in arrays-using-list Page\r\n\r\nGiven The user is in the arrays-using-list page\r\nWhen The user clicks the Try here button in this Page\r\nThen The User should be redirected to Python Editor page\r\n\r\n\r\n ## Basic Operations Page Scenarios\r\n \r\n \r\n Scenario: Testing the  Basic Operations in Lists Python Editor page with Valid Python codes\r\n\r\nGiven The user is in the Basic Operations in Lists PY Editor Page\r\nWhen The user write the Valid python code in Editor and Clicks Run button\r\nThen The User should be able to see the output in the console\r\n\r\n\r\nScenario: Testing the  Basic Operations Page - Python Editor with In-Valid Python codes\r\n\r\nGiven The user is in the Basic Operations in Lists PY Editor Page\r\nWhen The user write the Valid python code in Editor and Clicks Run button\r\nThen The User should be able to see the output in the console\r\n\r\n\r\nScenario: Testing the  Basic Operations Page - Python Editor without Python codes\r\n\r\nGiven The user is in the Basic Operations in Lists PY Editor Page\r\nWhen The user clicks the Run without any Codes\r\nThen The User should should be in the same page with No error message \r\n\r\n\r\nScenario: Testing the Try here in Basic Operations Page\r\n\r\nGiven The user is in the Basic Operations in Lists page\r\nWhen The user clicks the Try here button in this Page\r\nThen The User should be redirected to Python Editor page\r\n\r\n \r\n ## Applications of array Page Scenarios\r\n \r\n\r\n Scenario: Testing the Applications of array Python Editor page with Valid Python codes\r\n\r\nGiven The user is in the Applications of array PY Editor Page\r\nWhen The user write the Valid python code in Editor and Clicks Run button\r\nThen The User should be able to see the output in the console\r\n\r\nScenario: Testing the  Applications of array - Python Editor with In-Valid Python codes\r\n\r\nGiven The user is in the Applications of array PY Editor Page\r\nWhen The user write the Valid python code in Editor and Clicks Run button\r\nThen The User should be able to see the output in the console\r\n\r\n\r\nScenario: Testing the  Applications of array - Python Editor without Python codes\r\n\r\nGiven The user is in the Applications of array PY Editor Page\r\nWhen The user clicks the Run without any Codes\r\nThen The User should should be in the same page with No error message \r\n\r\n\r\nScenario: Testing the Try here in Applications of array page\r\n\r\nGiven The user is in the Applications of array in Lists page\r\nWhen The user clicks the Try here button in this Page\r\nThen The User should be redirected to Python Editor page  \r\n\r\n\r\n## Python Editor Search the array -> Valid and Invalid\r\n\r\n\r\n Scenario: Testing the Search the array Practice question with In-Valid Python codes\r\n \r\nGiven The user is in the Search the array Practice question Editor Page\r\nWhen The user passed the Invalid '<Rownumber>' python code in the Python Editor \r\nThen The user should get the '<alert_RomNumber>' alert Message \r\n\r\n\r\nScenario: Testing the Search the array Practice question with Valid Python codes  \r\n \r\nGiven The user is in the Search the array Practice question Editor Page\r\nWhen The user passed the valid '<Rownumber>' python code in the Python Editor \r\nThen The user should see the output '<OutputRowNum>' in the console\r\n\r\n\r\n\r\n## Python Editor Max Consecutive one Page -> Valid and Invalid\r\n\r\n\r\n\r\nScenario: Testing the python Editor in Max Consecutive one Page with Valid Codes \r\n\r\nGiven The user is in the Max consecutive one Python Editor Page\r\nWhen The user passed the Valid '<rownumber>' python code for Max Consecutive one\r\nThen The user should see the Valid output '<OutputRowNum_3>' in the console\r\n\r\n\r\n\r\nScenario: Testing the python Editor in Max Consecutive one Page with In-Valid Codes\r\n\r\nGiven The user is in the Max consecutive one Python Editor Page\r\nWhen The user passed the In-Valid '<rownumber>' python code for Max Consecutive one\r\nThen The user should get the Alert '<alert_RomNumber_4>'  Message in the Pop Up\r\n\r\n  \r\n   ## Python Editor Find Numbers with Even number of digits -> Valid and Invalid\r\n   \r\n\r\nScenario: Testing the Find Numbers with Even number of digits question page with valid codes \r\n\r\nGiven The user is in the Find Numbers with Even number of digits Python Editor Page\r\nWhen The user passed the Valid Python codes '<ExcelRowNum>' for the Python Editor Page\r\nThen The user should see the correct '<Outout_RowNum_5>' output in the console\r\n\r\n\r\n\r\nScenario: Testing the Find Numbers with Even number of digits question page with In-valid codes \r\n\r\nGiven The user is in the Find Numbers with Even number of digits Python Editor Page\r\nWhen The user passed the In-Valid Python codes '<ExcelRowNum>' for the Python Editor Page\r\nThen The user should get the alert Message '<Alert_RowNumber_6>' in the pop up for Even number Question\r\n\r\n \r\n \r\n ## Python Editor Squares of Sorted array -> Valid and Invalid\r\n \r\n\r\nScenario: Testing the Squares of Sorted array question with Valid codes \r\n\r\nGiven The User is  in the Squares of Sorted array Page Python Editor\r\nWhen The user passed the Valid Python codes '<ExcelRowNum>' for the Squares of Sorted array Python Editor Page\r\nThen The user should see the Corresponding output '<Outout_RowNum_7>' in the console\r\n\r\n\r\n\r\nScenario: Testing the Squares of Sorted array question with In-Valid codes\r\n\r\nGiven The User is  in the Squares of Sorted array Page Python Editor\r\nWhen The user passed the In-Valid Python codes '<ExcelRowNum>' for the Squares of Sorted array Python Editor Page\r\nThen The user should get the alert Message '<Alert_RowNumber_8>' for the Sorted array Python Editor Page\r\n\r\n\r\n\r\n\r\n## Search the array  ->Submit button # Negative Scenario --> It will fail  --> Bug\r\n\r\n\r\nScenario: Testing the Submit button valid codes in Search the array Practice question   \r\n\r\nGiven The user is in the Search the array Practice question Editor Page\r\nWhen The user clicks the submit button with '<rowNum>' Valid Codes\r\nThen The should see the submission successful message '<Success_RowNumer_9>' in the console\r\n\r\n\r\n\r\n## Max Consecutive one Page -> Submit button  # Negative Scenario --> It will fail  --> Bug\r\n\r\n\r\nScenario: Testing the Submit button with valid codes in Max Consecutive one Page Python Editor\r\n\r\nGiven The user is in the Max consecutive one Python Editor Page\r\nWhen  The user clicks the submit button with '<rowNumber>' Valid Codes in Max Consecutive one Page\r\nThen The user should see the success message '<Success_RowNumer_10>' in the console for Max Consecutive one Page\r\n\r\n\r\n\r\n## Find Numbers with Even number of digits question--> Submit Button  \r\n\r\n\r\nScenario: Testing the Submit button with valid codes in Find Numbers with Even number of digits question page Python Editor \r\n\r\n\r\nGiven The user is in the Find Numbers with Even number of digits Python Editor Page\r\nWhen The user clicks the submit button with '<rowNumber>' Valid codes in Even number of digits question page\r\nThen The should see the submission successful message '<Success_RowNumer_11>' in the console for Even number of digits question page\r\n\r\n\r\n\r\n## Python Editor Squares of Sorted array  -> Submit button # Negative Scenario --> It will fail  --> Bug\r\n\r\n\r\nScenario: Testing the Submit button valid codes in Squares of a Sorted Array\r\n\r\nGiven The User is  in the Squares of Sorted array Page Python Editor\r\nWhen The user clicks the Submit button with '<rownumber>' Valid codes in Squares of a sorted Array Page\r\nThen The should see the  successful message in the console '<Success_RowNumer_12>' in the console for Squares of a sorted Array Page\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/NumpyNinja\/NN_DS_Algo\/DS_ALGO_August_Currently%20Working\/NN_DS_ALGO_SDET-WARRIORS\/.\/FeatureFiles\/Array.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Testing the functionalities of Array Page","description":"","children":[{"background":{"location":{"line":3,"column":1},"keyword":"Background","name":"Login to the DS ALGO Application","description":"","steps":[{"location":{"line":5,"column":2},"keyword":"Given ","keywordType":"Context","text":"User moves to home page after login to application","i rted Array Page"},{"astNodeIds":["defee0d8-b56d-47f7-8925-535dab20ea7c"],"id":"90417637-f8b4-4c76-be3d-03eb9829ac0d","type":"Outcome","text":"The should see the  successful message in the console '<Success_RowNumer_12>' in the console for Squares of a sorted Array Page"}],"tags":[],"astNodeIds":["2b2e57e2-5d5e-4b9d-b317-d57c5edaa7b5"]}},{"source":{"uri":"file:\/\/\/C:\/NumpyNinja\/NN_DS_Algo\/DS_ALGO_August_Currently%20Working\/NN_DS_ALGO_SDET-WARRIORS\/.\/FeatureFiles\/DataStructure.feature","data":"Feature: Testing the Data Structures Introduction Page\n\nBackground: Login to the Ds-Algo Page\n\nGiven The User is in the Home page after clicking the Get started button \nThen The user clicks SignIn button in Home Page\nThen The User Enters the user name in the Username field\nAnd The User enters the password in the Password field\nThen The user clicks the Login button\nThen the User should be able to login to the application\n\n\nScenario: Testing the DS Introduction get started button in Home Page\n\nGiven The user is in the home Page after logged In\nWhen The user clicks the Get started button for DS Introduction tab \nThen The user should be Redirected to the DS Introduction Page \n\n\nScenario: Testing the Time Complexity Link in DS-Introduction Page\n\nGiven The User is in the DS Introduction Page after Logged In\nWhen The User clicks the Time Complexity link in the bottom of the Page\nThen The User should be Redirected to the Time Complexity Page\n\nScenario: Testing the Practice Questions link in the Time Complexity Page\n\nGiven The User in the Time Complexity Page \nWhen The user clicks practice questions link \nThen The user should be redirected to the Practice question Page \n\n\n Scenario: Testing the Time Complexity link in the left panel of the Time Complexity Page\n \n Given The User is in the Time Complexity Page \n When The user clicks Time Complexity link in the left panel\n Then The user should be stayed in the same Time Complexity Page\n \n \n Scenario: Testing the Try here button in the Time complexity Page\n \n Given The User is in the  DS_Time Complexity Page after login\n When The user clicks the Try here button in this Page\n Then The User should be redirected to Python Editor page\n \n @test\nScenario: Testing the DS-Python Try Editor page without any Python codes\n\nGiven The User is in the DS-Python Try Editor page  \nWhen The user clicks the Run without any Codes\nThen The User should should be in the same page with No error message\n\n\nScenario: Testing the DS-Python Try Editor page with Valid any Python codes\n\nGiven The User in the DS-Python Try Editor page \nWhen The user write the Valid python code in Editor and Clicks Run button\nThen The User should be able to see the output in the console\n\n\nScenario: Testing the DS-Python Try Editor page with InValid any Python codes\n\nGiven The User in the DS-Python Try Editor page after clicking Try Here button\nWhen  The user write the InValid python code in Editor and Clicks Run button\nThen  The User should be able to see error message in the pop message\n\n\t\n\tScenario: Testing the Sign out link in the DS Introduction page\n\t\n\tGiven The user is in the DS Introduction page\n\tWhen The user clicks the sign out button\t\t\n\tThen The user should be signed out successfully and got error message\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/NumpyNinja\/NN_DS_Algo\/DS_ALGO_August_Currently%20Working\/NN_DS_ALGO_SDET-WARRIORS\/.\/FeatureFiles\/DataStructure.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Testing the Data Structures Introduction Page","description":"","children":[{"background":{"location":{"line":3,"column":1},"keyword":"Background","name":"Login to the Ds-Algo Page","description":"","steps":[{"location":{"line":5,"column":1},"keyword":"Given ","keywordType":"Context","text":"The User is in the Home page after clicking the Get s ould be navigate to the Implementation using collections queue Page\n\n\nScenario: Testing the Implementation using Array link from the Left panel links\n\nGiven The user is in the  Implementation of Queue Page \nWhen The user clicks the Implementation using Array link in this Page from the left panel links\nThen The user should be navigate to the Implementation using Array Page\n\n\nScenario: Testing the Queue Operations link from the Left panel links\n\nGiven The user is in the  Implementation of Queue Page\nWhen The user clicks the Queue Operations link in this Page from the Left panel links\nThen The user should be navigate to the Queue Operations Page\n\n\nScenario: Testing the Practice Questions link from the Left panel links\n\nGiven The user is in the  Implementation of Queue Page\nWhen The user clicks the Practice Questions link in this Page\nThen The user should be navigate to the  Practice Questions Page\n\n\nScenario: Testing the Try here in Implementation of Queue in Python Page\n\nGiven The user is in the  Implementation of Queue Page\nWhen The user clicks the Try here button in this Page\nThen The User should be redirected to Python Editor page\n\n \nScenario: Testing the Implementation of Queue Python Editor with Valid codes\n\nGiven The User is in the Implementation of Queue  Editor Page\nWhen The user write the Valid python code in Editor and Clicks Run button\nThen The User should be able to see the output in the console\n\n\nScenario: Testing the Implementation of Queue Python Try Editor page without any Python codes\n\nGiven The User is in the Implementation of Queue  Editor Page\nWhen The user clicks the Run without any Codes\nThen The User should should be in the same page with No error message\n\n\nScenario: Testing the Implementation of Queue Python Editor with InValid codes\n\nGiven The User is in the Implementation of Queue  Editor Page\nWhen The user write the Valid python code in Editor and Clicks Run button\nThen The User should be able to see the output in the console\n\n\n\nScenario: Testing the Try here in Implementation using collections.queue in Python Page\n\nGiven The User is in the Implementation using collections.queue Page\nWhen The user clicks the Try here button in this Page\nThen The User should be redirected to Python Editor page\n\n\nScenario: Testing the Implementation using collections.queue page Python Editor with Valid codes\n\nGiven The User is in the Implementation using collections.queue Python Editor Page\nWhen The user write the Valid python code in Editor and Clicks Run button\nThen The User should be able to see the output in the console\n\n\nScenario: Testing the Implementation using collections.queue Python Try Editor page without any Python codes\n\nGiven The User is in the Implementation using collections.queue Python Editor Page\nWhen The user clicks the Run without any Codes\nThen The User should should be in the same page with No error message\n\n\nScenario: Testing the Implementation using collections.queue PY_Editor with InValid codes\n\nGiven The User is in the Implementation using collections.queue Python Editor Page\nWhen  The user write the InValid python code in Editor and Clicks Run button\nThen  The User should be able to see error message in the pop message\n\n\nScenario: Testing the Try here in Implementation using array in Python Page\n \nGiven The User is in the Implementation using array Page\nWhen The user clicks the Try here button in this Page\nThen The User should be redirected to Python Editor page\n\n\nScenario: Testing the Implementation using array page Python Editor with Valid codes\n\nGiven The User is in the Implementation using array Page Python Editor \nWhen The user write the Valid python code in Editor and Clicks Run button\nThen The User should be able to see the output in the console\n\n\nScenario: Testing the Implementation using array Python Try Editor page without any Python codes\n\nGiven The User is in the Implementation using array Page Python Editor  \nWhen The user clicks the Run without any Codes\nThen The User should should be in the same page with No error message\n\n\nScenario: Testing the Implementation using array Python Editor with InValid codes\n\nGiven The User is in the Implementation using array Page Python Editor  \nWhen  The user write the InValid python code in Editor and Clicks Run button\nThen  The User should be able to see error message in the pop message\n\n\nScenario: Testing the Try here in Queue Operations in Python Page\n\nGiven The User is in the Queue Operations Page\nWhen The user clicks the Try here button in this Page\nThen The User should be redirected to Python Editor page\n\n\nScenario: Testing the Queue Operations Python Editor with Valid codes\n\nGiven The User is in the Queue Operations Page Python Editor Page \nWhen The user write the Valid python code in Editor and Clicks Run button\nThen The User should be able to see the output in the console\n\n\nScenario: Testing the Queue Operations  Python Try Editor page without any Python codes\n\nGiven The User is in the Queue Operations Page Python Editor Page \nWhen The user clicks the Run without any Codes\nThen The User should should be in the same page with No error message\n\n\n\nScenario: Testing the Queue Operations Python Editor with InValid codes\n  \nGiven The User is in the Queue Operations Page Python Editor Page \nWhen  The user write the InValid python code in Editor and Clicks Run button\nThen  The User should be able to see error message in the pop message\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/NumpyNinja\/NN_DS_Algo\/DS_ALGO_August_Currently%20Working\/NN_DS_ALGO_SDET-WARRIORS\/.\/FeatureFiles\/Queue.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Testing the Functionalities of Queue Page","description":"","children":[{"background":{"location":{"line":3,"column":1},"keyword":"Backgr gned in with newly registered username link\n\n  Scenario: Test to register a new user with an existing password\n    Given User provides NEW username \"username\" and an ALREADY existing \"password\" and \"password confirmation\" details\n    When User clicks the Register button\n    Then New Account Created message is displayed at home page\n\n  Scenario: Test to register a new user with different password and password confirmation details\n    Given User provides valid username \"username\" but different password \"password\" and password confirmation \"pwd-confirm\" details\n    When User clicks the Register button\n    Then Error message stating password mismatch should be displayed\n\n  Scenario: Test to register a new user with an existing username\n    Given User provides EXISTING username \"username\" but valid password \"password\" and password confirmation \"pwd-confirm\" details\n    When User clicks the Register button\n    Then Error message stating username already exists should be displayed\n    \n  \n  Scenario Outline: Test to register a new user with unaccepted password details\n    Given User provides valid username \"<username>\" but unaccepted password \"<password>\" data\n    When User clicks the Register button\n    Then Error message stating password setting rules should be displayed\n\n    Examples: \n      | username  | password     |\n      | dfsjdfhgh | trial12      |\n      | jgfgfggfh |     12345678 |\n      | fdjfhjdsf | Password@143 |\n\n  Scenario: Test to move to login page from register page\n    When User clicks the Login link at the bottom of Register page\n    Then Sign In page must be displayed\n\n  \n  Scenario Outline: Test to register a new user without providing username or password or password confirmation details\n    Given User enters a valid username \"<username>\" and password  \"<password>\" and password confirmation \"<pwd_confirm>\" details\n    When User clicks the Register button\n    Then Validation message Please Fill Out This Field should be displayed at \"<username>\" \"<password>\" \"<pwd_confirm>\" missed field\n\n    Examples: \n      | username  | password  | pwd_confirm |\n      |           | Tiger@123 | Tiger@123   |\n      | Tryuser12 |           | Tiget@123   |\n      | Tryuser12 | Tiget@123 |             |\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/NumpyNinja\/NN_DS_Algo\/DS_ALGO_August_Currently%20Working\/NN_DS_ALGO_SDET-WARRIORS\/.\/FeatureFiles\/Register.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"To test the functionality of Register page","description":"","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"User clicks the GetStarted button at start page","id":"da952ba3-7366-42d8-8bfb-d3d7eb5497a7"},{"location":{"line":5,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User clicks the Register link at home page","id":"9d9cc2a7-929c-43eb-952e-3458c5022e5a"}],"id":"df64c873-9cbe-4cc4-9974-3fdb0e2a4c1c"}},{"scenario":{"location":{"line":7,"column":3},"tags":[],"keyword":"Scenario","name":"Test to register a new user with valid details","description":"","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","keywordType":"Context","text":"User provides valid username \"username\" password \"password\" and password confirmation \"password_confirmation\" details at register page","id":"30fec12a-6bca-4c9e-9e3d-2f88beb7bfa0"},{"location":{"line":9,"column":5},"keyword":"When ","keywordType":"Action","text":"User clicks the Register button","id":"c0fa827a-d568-4f22-89c9-08d15b0dbd96"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"New Account Created message is displayed at home page","id":"ed30e729-2034-456c-b0a2-14fe423481e4"}],"examples":[],"i ge  \n \t\tWhen The user write the Valid python code in Editor and Clicks Run button\n\t\tThen The User should be able to see the output in the console\n\n Scenario: Testing the online editor in the StackOperationspage invalid python code\n \t\tGiven The user is in the try editor page of the StackOperationspage\n    When  The user write the InValid python code in Editor and Clicks Run button\n\t\tThen  The User should be able to see error message in the pop message\n\n Scenario: Testing the online editor in the StackOperationspage no code at all\n\t Given The user is in the try editor page of the StackOperationspage \t\t\n\t When The user clicks the Run without any Codes\nThen The User should should be in the same page with No error message\n\t \t \n\t\n\n \t#Implementations\n \t\n \t\tScenario: Testing the Implementations tab in Stackpage\n  \n  When The user clicks Implementations tab in the Stackpage\n  Then The user should be redirected to the Implementations Page\n  \nScenario: Testing the TryHere button in the StackImplementationspage \n \n  Given The user is in the StackImplementationspage\n When The user clicks the Try here button in the StackImplementationspage\n  Then The user should be redirected to the Try editor console page\n\n \n Scenario: Testing the online editor in the StackImplementationspage with valid python code\n \t\tGiven The user is in the try editor page of the StackImplementationspage  \n \t\tWhen The user write the Valid python code in Editor and Clicks Run button\n\t\tThen The User should be able to see the output in the console\n\n Scenario: Testing the online editor in the StackImplementationspage invalid python code\n \t\tGiven The user is in the try editor page of the StackImplementationspage\n    When  The user write the InValid python code in Editor and Clicks Run button\n\t\tThen  The User should be able to see error message in the pop message\n\n Scenario: Testing the online editor in the StackImplementationspage no code at all\n
